import React from 'react'
import './home.css';
import * as FaIcons from 'react-icons/fa';

const Home = () => {
    return (
        <>
          
          <div id='home'>
            <h1 className='title'>Hello, my name is Charlie</h1>
            <p className='home-text'>Hello, my name is Charlie, I am a front-end developer from the UK. I program in JavaScript as well as working with many front-end technologies. I specialise in building component-based interfaces with ReactJS.</p>
            <a className='btn btn-outline-success'>view my work<br /><FaIcons.FaArrowCircleDown className='icon'/></a>
           </div> 
        </>
    )
}

export default Home
